void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void wait_for_vsync(){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	//swap the back and front buffers
	//front buffer is just the buffer address 
	
	//front buffer
	volatile int *buffer_reg = (int*)0xFF203020;	
	
	//write a 1 to the buffer register
	*buffer_reg = 1; //write to the buffer register
	
	//status register
	volatile int *status_reg = 0xFF20302C;	
	
	//read from the S bit from the Status Register & with 1 to get S bit
	int s_bit = *status_reg & 1; //read status reg
	
	while(s_bit != 0){
		s_bit = *status_reg & 1; //keep reading the status bit
	}
    //swap buffers
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

	return;
}

void write_char(int x, int y, char c) {
  // VGA character buffer
  volatile char * character_buffer = (char *) (FPGA_CHAR_BASE + (y<<7) + x);
  *character_buffer = c;

}

int main(void)
{
	volatile int * adc_ptr = (int*) ADC_BASE;
	*(adc_ptr+1)=1;
	volatile int * sw_ptr = (int *)SW_BASE;
	volatile int * key_ptr = (int *)KEY_BASE; 
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pixel_ctrl_ptr;

	//clear screen
   // home_screen();
	
	/* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
	
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	set_A9_IRQ_stack();
config_A9_private_timer();
config_GIC();
enable_A9_interrupts();
volatile int * timer_ptr = (int *)A9_PRIVATE_BASE;
*(timer_ptr+2) = 6; 
    while (1)
    {
        //if sw0 is on, begin the game
		while(screen_state == 1){ //while the switch is on; game is running 		
            blank_screen();
			starting_game();
			wait_for_vsync(); // swap front and back buffers on VGA vertical sync
			pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
			check_keys();
		}
        //turn the second sw on if u won
        while(screen_state == 2){ 
               // win_screen(); 
                lose_screen();
                wait_for_vsync(); // swap front and back buffers on VGA vertical sync
                pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
				check_keys();
        }	
		while(screen_state == 3){
			win_screen();
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
			check_keys();
			
		}
        while(screen_state == 0){
            //if sw0 is not on, home_screen
            clear_screen();
            home_screen();
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
			check_keys();
        }
	}
	return 0;	
}

